import React from 'react'

const Contacts = ({contacts}) => {
    return (
        <div>
            <center><h1>Contact List</h1></center>
            {contacts.map((contact) => (
                <div class="card">
                    <div class="card-body">
                        <div class="card-title">{contact.id}</div>
                        <h6 class="card-subtitle mb-2 text-muted">{contact.port}</h6>
                    </div>
                </div>
            ))}
        </div>
    )
};

export default Contacts
